import React, { StrictMode } from "react";
import ReactDOM from "react-dom/client";
import './index.css'

ReactDOM.createRoot(document.getElementById("root")).render(
    <StrictMode>
      <div className="container">
        <img className="profile-img" src="https://via.placeholder.com/150" alt="hossein" />
        <h1 className="name">Hossein Azhdarloo</h1>
        <h2 className="title">Frant_End Devloper</h2>
        <p className="about">من یک برنامه نویس تازه کارم ک با انگیزه و تمرین زیاد میخوام به یه دولوپر حرفه ای تبدیل بشم. عاشق یادگیری هستم و هدفم ورود به React و بازا</p>
      </div>
    </StrictMode>
  );
